import axios from "axios";

export async function getBlogById(id) {
    return await axios.get(`http://localhost:4014/article/detail/${id}`,{
        transformResponse: [function (data) {
            // 对 data 进行任意转换处理
            console.log("transformData", data);
            return data;
        }],
    });
}
